import { Navbar, Nav, Container, Form, FormControl,Button } from   "react-bootstrap";
import { useState } from "react";
import AddMovie from "./AddMovie";

function NavBar ({addMovie}){
  const [show, setShow] = useState("true");
    return(
 <>
    <Navbar bg="light" variant="light">
        <Container>
        <Navbar.Brand href="#home">Movies</Navbar.Brand>

        <Form style={{marginRight:"25%", width:"350px"}}>
              <FormControl
                type="search"
                placeholder="Search"
                className="me-2"
                aria-label="Search"
              />
        </Form>
        </Container>
        <Nav>
          <Button style={{marginRight:"20px", width:"200px"}} variant="outline-success" onClick={() => setShow(!show)} >Add New Movie</Button>
        </Nav>
    </Navbar>
    <div className="Add">
    <AddMovie  addMovie={addMovie} />
    </div>


 </>
    )
}
export default NavBar;
